merge into Market.CashRate as target
using #CashRate as source
	on target.CashRateID = source.CashRateID
when matched and (source.CashRate <> target.CashRate or source.EffectiveEndDate <> target.EffectiveEndDate) then update
	set CashRate = source.CashRate,
		EffectiveStartDate = source.EffectiveStartDate,
		EffectiveEndDate = source.EffectiveEndDate,
		UpdatedDateTime = sysutcdatetime(),
		UpdatedBy = system_user
when not matched by target then
	insert (CashRateID, CashRate, EffectiveStartDate, EffectiveEndDate)
	values (CashRateID, source.CashRate, source.EffectiveStartDate, source.EffectiveEndDate)
when not matched by source then
	delete;